to catch errors?

Ok, you can create a new file there, neutron.agent.linux.ethtool.

In this file you can create a class to handle ethtool commands. Something like FdbInterface or BridgeDevice.

You can add a single method in this class, "offload", with three parameters, "device", "rx" and "tx".

class Ethtool(object):

    COMMAND = 'ethtool'

    @staticmethod
    def _cmd(cmd, namespace, **kwargs):
        ip_wrapper = ip_lib.IPWrapper(namespace)
        cmd = [cls.COMMAND] + cmd
        return ip_wrapper.netns.execute(cmd, run_as_root=True, **kwargs)

    @staticmethod
    def offload(cls, device, rx=False, tx=False, namespace=None):
        rx = 'on' if rx else 'off'
        tx = 'on' if tx else 'off'
        cmd = ['--offload', device, 'rx', rx, 'tx'. tx]
        cls._cmd(cmd, namespace)

